pragma solidity >=0.4.21 <0.6.0;
contract PatientRecords {
    address Owner  ;

    struct Citizen {
        bool isUidGenerated ;
        string name ;
        uint age ; 
        address createdBy;
    }
    
    mapping (address=> Citizen) public citizenMapping;
    mapping (address =>bool) public doctroMapping;
   
   constructor() public{
       Owner =msg.sender;
   } 
    modifier onlyOwner() {
        require(Owner==msg.sender);
        _;
    }
    
    function setDoctor(address _address) onlyOwner public {
        require(doctroMapping[_address]);
        doctroMapping[_address]=true;
    }
    function setCitizen(string memory  _name , uint _age , address _createBy ) public{
        require(citizenMapping[msg.sender].isUidGenerated);
       citizenMapping[msg.sender].name = _name ; 
       citizenMapping[msg.sender].age = _age ; 
       citizenMapping[msg.sender].isUidGenerated=true;
       citizenMapping[msg.sender].createdBy=_createBy;
    }

   
    
}
